import React, { useState } from "react";
import "./DashboardHome.css";
import { FaMoneyCheckAlt } from "react-icons/fa";

function DashboardHome(props) {
  // Define some sample data for the table
  const data = [
    { id: 1, name: "Item 1", price: 10 },
    { id: 2, name: "Item 2", price: 20 },
    { id: 3, name: "Item 3", price: 30 },
    { id: 4, name: "Item 4", price: 40 },
    { id: 5, name: "Item 5", price: 50 },
    { id: 6, name: "Item 6", price: 60 },
    { id: 7, name: "Item 7", price: 70 },
    { id: 8, name: "Item 8", price: 80 },
    { id: 9, name: "Item 9", price: 90 },
    { id: 10, name: "Item 10", price: 100 },
  ];

  // Define state for the table
  const [showMore, setShowMore] = useState(false);
  const [tableData, setTableData] = useState(data.slice(0, 5));

  // Define a function to handle the "show more" button click
  const handleShowMore = () => {
    setShowMore(true);
    setTableData(data);
  };

  return (
    <div className="DashboardHome">
      <h1 className="WelcomeMessage">Welcome back {props.username}</h1>
      <div className="boxes">
        <div className="box1">
          <h2>Total Money Donated</h2>
          <p>All Time</p>
          <table>
            <thead>
              <tr>
                <th>Item</th>
                <th>Price</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((item) => (
                <tr key={item.id}>
                  <td>{item.name}</td>
                  <td>{item.price}</td>
                </tr>
              ))}
            </tbody>
          </table>
          {!showMore && (
            <button onClick={handleShowMore}>Show More</button>
          )}
        </div>
        <div className="box2">
          <h2>Total Items Donated</h2>
          <p>All Time</p>
          <table>
            <thead>
              <tr>
                <th>Item</th>
                <th>Price</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((item) => (
                <tr key={item.id}>
                  <td>{item.name}</td>
                  <td>{item.price}</td>
                </tr>
              ))}
            </tbody>
          </table>
          {!showMore && (
            <button onClick={handleShowMore}>Show More</button>
          )}
        </div>
        <div className="box2">
          <h2>Last Donation</h2>
          <p>10 Oct 2022</p>
        </div>
      </div>
    </div>
  );
}

export default DashboardHome;
